パッケージサイズ H180×W85×D85mm<br>重量 250g<br>備考 クロス付属<br><br>仕様 <br>&#8226;クリーナー効果+ペルシード加工<br>洗車では落とし切れない水垢等を除去し、バランス良くボディ本来の輝きを甦らせるコーティング前のクリーナー。<br><br>&#8226;これ1本でもキレイな仕上がり<br>ペルシードナチュラルガラスエッセンスが配合されているので、水垢や汚れを落としながらコーティング効果が得られる。<br><br>&#8226;ペルシード加工がさらに増す<br>クリーナー効果にペルシード加工がプラスされるので、ペルシードを使用する前に最適な下地処理ができ、さらにペルシード加工の効果が増す。<br><br>&#8226;ボディの他にホイール、未塗装樹脂パーツ、メッキ塗装パーツ、ヘッドライト等ボディ以外にも使用可能。<br>マスキングなどの手間も不要で施工が簡単。<br><br><br>※2016年8月10日現在の情報です。最新情報はメーカーページをご確認ください。<style type="text/css">
