ボディー・フロントガラス等に付着した昆虫の死骸をすばやく取り除く、ハンディスプレータイプの虫取りクリーナ。専用開発の中性洗浄成分が、ボディー表面に押し潰され、こびりついた昆虫の死骸をスピーディーに除去します。 <br>昆虫の死骸は、ボディー表面に長期間放置しておくと、塗装にダメージを残すことがありますので、気づいた時点でこまめにクリーニングすることをお勧めします。<br>■虫取りクリーナー　　　■容量：500ml　　　■カープレミアムカーケアジャパン正規品 <br>ユニバーサル <br>　車検対応品<br>カーケア/カーケアその他<tr><td colspan="2">
