・極超微粒子の研磨剤の使用により、ガラスコーティング施工車にも安心して使用できる研磨剤配合の汚れ落とし剤。・RHシリーズとボディの密着効果を高めるプライマー効果も配合しております。・水洗いと同時に使用も可能なウエット&ドライのハイブリッドタイプですので、RHシリーズの施工へそのまま移行できます。内容量：200ml<br><br>ACTICAREカーケミカルは2014年に始動した新鋭ケミカルメーカーです。コーティング施工車からDIYでのカーケアまで素材と品質に拘りながらも「プロ級の仕上がり」でありながら、コーティング施工車からDIYでのカーケアまで使いやすさや価格などもトータルで「楽しくなる」洗車環境を皆様に提案します。<br><br><br><br><br><br><br>カーケア | ワックス<br>汎用パーツ | 汎用パーツ | 全て<tr><td colspan="2">
