RH3は石油成分などを含有しない、純国産製品で他製品と比較して高濃度、高純度レジン配合の高撥水コーティング剤です。静電気を抑えるなどの性質を持ち、汚れが付きにくく、高品質な保護膜を形成します。使用方法は洗車後の濡れたボティにRH3をクロスに少量を吹き付け、乾拭き作業と同時に施工して下さい。繰り返し施工をする事により、更に強固な被膜を形成し、持続力も通常の簡易型コーティング剤に比べ3倍の持続力を持ちます。この品質でこのお値段！内容量 100ml 　普通車で5回から10回程度の施工が可能です。<br><br>ACTICAREカーケミカルは2014年に始動した新鋭ケミカルメーカーです。コーティング施工車からDIYでのカーケアまで素材と品質に拘りながらも「プロ級の仕上がり」でありながら、コーティング施工車からDIYでのカーケアまで使いやすさや価格などもトータルで「楽しくなる」洗車環境を皆様に提案します。<br><br><br><br><br><br><br>カーケア | ワックス<br>汎用パーツ | 汎用パーツ | 全て<tr><td colspan="2">
